class ProxyMiddlewareByAbu(object):
    def __init__(self):
        # 代理服务器
        self.proxyServer = "http://proxy.abuyun.com:9020"

        # 代理隧道验证信息
        proxyUser = "HZ13QE48059T3W4D"
        proxyPass = "ACECDEA86F3841BD"

        self.proxyAuth = "Basic " + base64.b64encode(proxyUser + ":" + proxyPass)

    def process_request(self, request, spider):

        request.meta["proxy"] = self.proxyServer
        request.headers["Proxy-Authorization"] = self.proxyAuth

    def process_response(self, request, response, spider):
        if response.status != 200 \
                and (not hasattr(spider, "website_possible_httpstatus_list") \
                             or response.status not in spider.website_possible_httpstatus_list):
            self.defaultIP = ''

            new_request = request.copy()
            new_request.dont_filter = True
            return new_request
        else:
            return response


    def process_exception(self, request, exception, spider):
        new_request = request.copy()
        new_request.dont_filter = True
        return new_request
